import "./App.css";
import MadeGoal from "./MadeGoal";
import MissedGoal from "./MissedGoal";

function Garage(props) {
  const cars = props.cars;
  return (
    <>
      <h1>Garage</h1>
      {cars.length > 0 && <h2>You have {cars.length} cars in your garage</h2>}
    </>
  );
}
const cars = [];

function App() {
  return (
    <>
      <LogIn isLoggedIn={cars} />
    </>
  );
}

export default App;
